llm_output:
function transfer(address recipient, uint256 amount) public returns (bool) {
    require(tradingOpen, "Trading is not open");
    require(amount > 0, "Transfer amount must be greater than zero");
    require(amount <= _maxTxAmount, "Exceeds the _maxTxAmount");
    require(balanceOf(msg.sender) >= amount, "Insufficient balance");
    require(balanceOf(recipient) + amount <= _maxWalletSize, "Exceeds the _maxWalletSize");

    uint256 taxAmount = 0;
    if (recipient == uniswapV2Pair && swapEnabled) {
        taxAmount = (amount * _sellTax) / 100;
    } else if (msg.sender == uniswapV2Pair) {
        taxAmount = (amount * _buyTax) / 100;
    }

    uint256 transferAmount = amount - taxAmount;

    _balances[msg.sender] -= amount;
    _balances[recipient] += transferAmount;
    _balances[address(this)] += taxAmount;

    emit Transfer(msg.sender, recipient, transferAmount);
    if (taxAmount > 0) {
        emit Transfer(msg.sender, address(this), taxAmount);
    }

    return true;
}

